s:12:"created_time";i:1599245692;}i:133;a:1:{s:7:"caption";s:1194:"@alecbaulding
—
Being able to adjust your level of resistance is super important in training. Some students toll at 100% every round and needless to say there is a time and place when you will need to go hard, like in a tournament, but there is certainly a sweet spot.

If you go too hard you won’t be able to open up your game to learn and experiment. The best training environments for Alec were the ones where he had a few training partners levels above while also a cohort of training partners right on his level (and of course some junior students, as well.) The high level training partners are perfect to test yourself and go maybe 60-85%. Respectful, but training with learning in mind. The cohorts on the same level go all out so close to tournament speed (100%), and then juniors students are perfect for training new moves, working defenses and versatility while also letting them work (30-50%.)
—
